2. <i>Say Hello, Say Goodbye</i>
 
<lj-cut text="A different boy. A boy who is now dead.">1863
 
Hoarse screams could be heard from the end of the corridor, shouting a litany of violence and desperation to the stale air of the hospital ward. &ldquo;STOP!! &lsquo;S HURTS!!&rdquo; it says one moment, then, &ldquo;SCREW YOU CONFEDERACY BASTAARRDD!!&rdquo; the next. They were followed by the sound of a blunt object colliding against something hard.
 
Arthur shut his eyes and refrained from covering his ears. His twitching hand reached for a cup of tea for distraction. He took a deep breath before exhaling in desolation. &ldquo;&hellip;is there any other option&hellip;?&rdquo;
 
Matthew shot his caretaker an apologetic look. &ldquo;The psychiatrists have tried their best, Mr. Arthur&hellip;&rdquo; he said meekly. &ldquo;Even the strongest drug isn&rsquo;t enough to quell his conflicting split personalities&hellip;&rdquo;
 
Arthur couldn&rsquo;t believe he&rsquo;s suggesting this. &ldquo;&hellip;Can&rsquo;t we wait until one side can turn the tide? He will be stabilized then.&rdquo; The notion was against his rationales...but Arthur refused, refused to give up on the little boy he&rsquo;d found in Jamestown three hundred years ago, held, nurtured, and showered so much love to. Even though the baby grew up to betray him and break his heart, Arthur would never forget the reverence, the adoration in those clear sky blue eyes, the small hands that held his tight, the soft blonde locks rubbing against his chest as Alfred Williams slept peacefully. The apple of his eye, the gem of his heart.
 
&ldquo;&hellip;Mr. Arthur,&rdquo; Matthew&rsquo;s gaze turned to one of pity. &ldquo;The battles have been in a standstill for almost three years, now&hellip;and Alfred keeps on breaking his cuffs&hellip;no one can match his strength&hellip;&rdquo;
 
Something was off. &ldquo;What made you so sure that his successor won&rsquo;t end up in the same situation?&rdquo;
 
President Lincoln&rsquo;s gaze wavered and Arthur clenched his fist around his cup so hard his knuckles were almost as white as the porcelain.
 
So that was the agenda. America&rsquo;s boss thought that if his nation&rsquo;s embodiment&rsquo;s ideals mirrored the North&rsquo;s, the Union would emerge victorious. But Alfred Williams&rsquo; sanity is beyond manipulation. Lincoln wanted someone new, someone fresh (preferably a son of the Union), who could be influenced before he or she succumb to the madness of having one&rsquo;s own mind warring <i>constantly</i> against itself. Then the cycle would repeat again and again until one side won.
 
But Lincoln had no idea how a nation&rsquo;s personification is appointed, and while Mathieu Williams has lived since Jacques Chevalier [1] chose the three-year-old infant to be Canada, none of the embodiments of America&rsquo;s neighbours had needed replacements. Only the old, old Arthur Kirkland (seven hundred ninety seven years old and running, old even amongst the nations&rsquo; standards) had that knowledge, and by involving himself in the process, Lincoln could ensure that Arthur wouldn&rsquo;t choose a substitute who will give the Confederacy an upper hand. Two birds with one stone.
 
The cunning bastard, Arthur cursed. As if he&rsquo;d ever thought of <i>chucking Alfred aside, just like that, for something as fickle as a victory.</i> He&rsquo;d seen a similar forked path and he&rsquo;d chosen to drop his musket, then.
 
&ldquo;How could you?!&rdquo; Arthur banged his hands on the table and rose to his feet forcefully, causing the wooden chair to topple sideway. The cup shattered and the shards tore his skin, but the pain in his heart was more overwhelming. &ldquo;He is your nation!&rdquo;
 
&ldquo;This is the best course of action.&rdquo; The calm on Lincoln&rsquo;s fa&ccedil;ade pissed him, urged him to smash his spectacles and flatten his nose against the wall. Arthur&rsquo;s anger must have shown on his fair complexion, because before he even lunged at the man, Matthew was already hanging to his arm, shaking his head so hard his blonde curls were mussed around his face. &ldquo;Mr. Arthur, please-&rdquo; he begged, his breathing laboured.
 
His sight began to blur, and Arthur sucked a deep breath to hold the tears inside. &ldquo;He&rsquo;s your brother,&rdquo; he choked. &ldquo;Your twin. Born from the same womb. And you&rsquo;re telling me to let him die?&rdquo;
 
&ldquo;D-don&rsquo;t-&rdquo; Matthew&rsquo;s reply was ragged. &ldquo;Don&rsquo;t reprimand me! You&rsquo;re only here now, you don&rsquo;t know how it feels, to be next to him 24/7 for three years. I&rsquo;ve been with him as his condition deteriorated. He&rsquo;s in pain, p&egrave;re [2].&rdquo; The quiet, quiet young man unveiled his aggressive side as he pulled Arthur&rsquo;s collar and yelled to his face. He was so close; close enough to share the same breath, close enough for Arthur to see red lines around the white of Matthew&rsquo;s violet-blue irises, dark as the seas that surrounded him, to see the folds of dark skin sagging under his tired, tired eyes.
 
&ldquo;You have no idea how I feel. How he feels,&rdquo; he continued viciously. &ldquo;I&rsquo;ve spoken to him in one of his rare moments of lucidity. He told me himself.&rdquo; Matthew took a deep shuddering breath, and the glimmer in his eyes made its way out to fat crystalline droplets. &ldquo;He wants out.&rdquo;
 
The silence that ensued was oppressive, thick as a woolen blanket, covering his mouth and suffocating him. Arthur felt his mind detaching himself from his body when he finally answered, his voice sounding faraway as though there were cotton balls in his ears. &ldquo;&hellip;All right.&rdquo; He gave the verdict, the permission to pull the plug off.
 
As Arthur vaguely heard Lincoln&rsquo;s ordering his assistant to bring the files to the room, somewhere inside England, the ability to love another crumbled to dust and was never revived.
 
-------------------------
 
&ldquo;I like him,&rdquo; Lincoln shoved a blue folder under Arthur&rsquo;s nose and tapped his finger on his arms as he waited for England to finish reading the boy&rsquo;s profile. The President&rsquo;s stance just screamed impatience.
 
<i>Aaron Smith. Sex: M. DOB: 27/12/1850. Color or Race: W </i>[3]<i>. Hair: blonde. Eyes: blue. </i>The British Empire barely scanned through the data before he tossed his profile aside to the growing pile of rejected candidates. <i>Hobby: playing baseball. Dream: to be a President!! </i> Arthur snorted. &ldquo;Too nationalistic,&rdquo; he stated dismissively. &ldquo;Before a decade, he&rsquo;ll kill himself. Too much idealism will compel him to fly too close to the sun. And fall ingloriously.&rdquo;
 
Lincoln let out a frustrated groan. &ldquo;How about this one?&rdquo; He let go of all pretenses of politeness and tossed another folder.
 
<i>Edward McDougal. Sex: M. DOB: 03/03/1860. Color or Race: W. Hair: blonde. Eyes: blue.</i> Arthur swatted it instantaneously, causing it to nearly hit the President&rsquo;s face in its projection. &ldquo;Too young. In other situations, it works. In our situation, his sanity won&rsquo;t last.&rdquo;
 
&ldquo;Um&hellip;&rdquo; Matthew handed him a pink folder. &ldquo;Mr. Arthur, how about this&hellip;?&rdquo;
 
<i>Mercy Henderson. Sex: F. Color or Race: B. DOB: 21/04/1848. Hair: black. Eyes: brown. </i>Arthur raised an eyebrow. <i>Hobby: camping. Dream: to be a nurse.</i> &ldquo;&hellip;She can last,&rdquo; he turned it around to let Lincoln see. &ldquo;But are you sure?&rdquo;
 
Lincoln&rsquo;s eye twitched. &ldquo;&hellip;if you must.&rdquo;
 
Arthur placed it on top of a thin stack of potential successors. &ldquo;That&rsquo;s all you have?&rdquo;
 
The President threw his hands over his head. &ldquo;We&rsquo;ve been scouring through hundreds of profiles of children and teenagers for two days! And we managed to find several options! What&rsquo;s holding us back?&rdquo;
 
Arthur sighed. &ldquo;I haven&rsquo;t found one particular candidate that hits the bull&rsquo;s eye. So far, those &lsquo;options&rsquo; are really just skirting around it. Rationally speaking, they can be&hellip;America&rsquo;s next embodiment,&rdquo; he paused imperceptibly. &ldquo;But a huge part of the selection process is decided by nature, you know. If one doesn&rsquo;t think, &lsquo;this is it!&rsquo; after one look, then it&rsquo;s most probably not going to be him or her. You understand, don&rsquo;t you, Matthew?&rdquo;
 
Matthew was still for a while, before he gave a jerky nod. &ldquo;Well, I&rsquo;d never been involved in this kind of thing before&hellip;but I didn&rsquo;t feel &lsquo;this is the one,&rsquo; for any of the people we&rsquo;ve seen so far, so&hellip;&rdquo; he spoke hesitantly.
 
President Lincoln looked really, really stressed out. &ldquo;A lot of our youths have died in the battles, but I&rsquo;ll try,&rdquo; he pinched the bridge of his nose before reaching for the phone.
 
Arthur made use of the short break to get a cup of tea. He sipped it quietly before putting the porcelain to the saucer and opened his mouth. For a while, nothing escaped his lips. &ldquo;&hellip;We also need to show those &lsquo;options&rsquo; to Alfred, because he&rsquo;s the only one who knows, for sure.&rdquo;
 
Matthew and Lincoln said nothing in response.
 
They set out to work again after more profiles were delivered to the office. Hours probably passed before Arthur found the one. &ldquo;It&rsquo;s him,&rdquo; he stared at the photo for a long time, his heart rising to his throat and making him choke.
 
&ldquo;Who?&rdquo; Matthew and America&rsquo;s boss were making their way to England when the wooden doors to the office were suddenly slammed open. &ldquo;Mr. President!&rdquo; the young civil servant huffed, his breathing laboured. &ldquo;Mr. Alfred Williams, he-&rdquo;
 
Sounds ceased to exist. Arthur could only stare at the civil servant&rsquo;s mouth as it moved over the words he couldn&rsquo;t hear, words so terrible they were blocked out of his memories. From the corner of his eyes, he saw Matthew&rsquo;s knees buckling before the blonde slid to the floor as tears poured out of his eyes, his self-restraint, the dam that held the flood in broken. When his ears worked again, he could hear Canada&rsquo;s high-pitched screams, animalistic and blood-curdling.
 
But Arthur didn&rsquo;t shed a tear. His world crumbled below his feet, and he was too numb to care that he was going under.
 
-----------------------------------
 
They buried Alfred during sunset, with golden rays bathing the mahogany casket in an ethereal glow over the hills in Virginia. The scene was ironically beautiful, as the poor young man&rsquo;s corpse wasn&rsquo;t pretty. Alfred had killed himself by smashing his brains against the walls. Literally. Arthur deeply regretted that he couldn&rsquo;t have provided his baby a painless method to exit this world.
 
There was a message on the wall, written in blood. &lsquo;<i>I&rsquo;m sorry,&rsquo;</i> it said. Matthew broke down at the sight, while Arthur merely continued to walk the path to madness in silence. He was very sure that pieces of his heart and his sanity were locked inside that casket, next to his baby&rsquo;s prone carcass.
 
They didn&rsquo;t have time to mourn, though. Since Alfred didn&rsquo;t have the time to choose his successor, the trio had to search for the human nature had picked. There was a very high chance that his substitute was the boy Arthur had chosen (like he chose Alfred, centuries ago, before Jacques joined him and thought it was a brilliant idea to appoint Alfred&rsquo;s twin as the embodiment of his neighbour, Canada. Oh, Jacques, that damned fool&hellip;).
 
And that was what had led Arthur, Matthew and the President outside the porch of a painfully ordinary wooden house, one out of the many almost identical rows of rural housing in the countryside of Boston.
 
---------------------------------
 
&ldquo;Franklin!&rdquo; Maria called for her eldest boy. &ldquo;Come down and help mama!&rdquo;
 
&ldquo;In a minute!&rdquo; the bespectacled boy hollered, his eyes still glued to the breath-taking array of star constellations twinkling in the sky, like tiny diamonds spread over velvety dark blue carpet. A thick book was splayed open on his lap, a long list of labels lying still under the boy&rsquo;s fingers. <i>Sirius. Andromeda. Aries.</i>
 
Franklin loved astronomy and the outer space. His dream was to fly to another planet, one day.
 
&ldquo;FRANKLIN!&rdquo; Maria repeated more impatiently. &ldquo;Get your head out of the clouds and your feet back down to earth!!&rdquo;
 
The thin boy sighed. &ldquo;Coming, mama, coming!&rdquo; He closed his precious encyclopedia carefully &ndash; his one and only gift from his deceased father &ndash; and slipped out from the covers. Franklin was reaching for his crutches (he used to curse God for allowing polio to cripple him for life. Now, his feelings are mixed because his disability allowed him to stay with his mother while his father and brothers left for the front and were taken away from them in the blink of an eye) when <i>his eyes burned.</i>
 
A scream tore through the house, followed by heavy objects colliding against one another and falling to the floor. &ldquo;Franklin!?&rdquo; hurried footsteps could be heard, tapping in a crescendo before the door banged open, and colds hands wrapped around him, shaking him. &ldquo;Franklin, are you alright!?&rdquo;
 
His heart ached like it was split into two. Then his life ended.
 
---------------------------
 
When Arthur decided on Franklin Jones, he was betting against fate.
 
The boy in the grainy photo looked absolutely nothing like his dear Alfred. For one, he was scrawny and droopy &ndash; not one bit athletic. The eyes behind a pair of thick lenses of glasses were dark. His hobby was to look at the stars, and his dream was to fly. Not a single word in his profile alluded to advocating justice and freedom.
 
Lincoln had looked aghast when he saw Arthur&rsquo;s choice, hissing, &ldquo;You chose someone&hellip;with a disability to be our nation!?&rdquo;
 
He merely shrugged. &ldquo;Jones is smart. It surely offsets that? And just because the embodiment is weak, doesn&rsquo;t mean the country will be weak. No one knows for sure.&rdquo;
 
In the end, Lincoln lost the argument and let the older nation do whatever he deemed right. Perhaps the smart man thought he would use this chance to merely learn about how a nation is &lsquo;passed down&rsquo; from one embodiment to another and cast aside Arthur&rsquo;s choice after the Empire left. Arthur truly didn&rsquo;t know. And frankly, he didn&rsquo;t care much either.
 
&ldquo;Mr. Arthur,&rdquo; Matthew pulled him out of his reverie with a hand on his forearm. Arthur&rsquo;s head snapped in his direction, and the older male glanced at the uncertainty anxietysadness in the other blonde&rsquo;s dark blue eyes.
 
Lincoln was sitting across the two nations, tapping his fingers on his cane; out of impatience or anxiety, Arthur did not bother to find out. &ldquo;Shall we go now?&rdquo;
 
Arthur bit the insides of his mouth and opened the door of the carriage.
 
The walk across the front yard was like a dream. No sound registered in his mind when Arthur knocked the door. The acids in his abdomen wreaked havoc with his organ, like maggots eating his insides, as he waited and waited and <i>nothing&rsquo;s real, Alfred isn&rsquo;t dead, his baby is still alive, bright, sane and brimming with energy-</i>
 
&ldquo;Yes&hellip;?&rdquo; The door creaked open and for a second, Arthur thought that he was looking into a mirror. For the middle-aged woman who peered back at him had the same empty, desolate eyes above her ashen cheeks, and the gaze of someone who had lost all hope.
 
&ldquo;Mrs. Jones,&rdquo; Lincoln addressed the woman, and a spark of recognition appeared in those dark eyes, followed by awe and disbelief. &ldquo;I&rsquo;m sorry for disturbing you this afternoon. We are here to look for your son, Franklin. May we meet him?&rdquo;
 
The moment the name exited the President&rsquo;s lips, the weary woman took a sharp breath and grabbed his hand, her thin, brittle fingers trapping his wrist in an iron grip. &ldquo;Please,&rdquo; she threw any sense of propriety out of the window and pleaded while the man barely recovered from his shock, &ldquo;my son, he, he&rsquo;d fallen unconscious for days and after he woke up he&rsquo;s been delusional &ndash; please save him, Mr. President-&rdquo;
 
Arthur wasted no time in entering the house uninvited, his feet taking large, long strides as he blindly followed his instincts, dread sinking in his stomach with each step. Arthur could vaguely hear Matthew and the two humans tailing him as he climbed up the stairs and opened the door to the second room to the left without hesitation and-
 
<i>Gracious God</i>
 
---------------------------
 
&ldquo;Arthur&hellip;&rdquo;
 
The child sitting in the bed was nothing like Alfred. He was pale and thin instead of muscular and tanned. His hair was gingery brown, none of those sun-kissed locks that made the golden of ripe wheat pale in comparison. His facial features were completely wrong &ndash; rounded chin, shorter nose, low cheekbones, wider forehead &ndash; a commoner&rsquo;s face, completely different from Matthew&rsquo;s aristocratic bearings.
 
But he had Alfred&rsquo;s stubborn cowlick. And his eyes. <i>God, his eyes.</i>
 
Blue as a clear summer sky over this vast continent, blue as freedom, blue as love. Brightening as they lay on him.
 
&ldquo;Arthur,&rdquo; the boy shifted and planted his feet on the floor, the bones of his left knee curved outwards slightly, telltale signs of poliomyelitis, yet he rose to his feet with ease, and walked across the room normally. Arthur stood still as a statue, lost in grief and denial, and he was jolted back to earth when he felt the boy&rsquo;s arms wrap around him. &ldquo;Oh, Arthur, I miss you,&rdquo; he whispered against the fabric covering the older nation&rsquo;s torso, his breath moist and warm and alive but different, too different, &ldquo;I&rsquo;m sorry, England.&rdquo;
 
Arthur snapped at the sound of his name, the name of the nation he embodied, and took a step back. &ldquo;No&hellip;&rdquo; he began to struggle from the embrace, causing the boy to look up. &ldquo;Arthur?&rdquo; the boy pleaded and haunt him, haunt Arthur with that familiar puppy-eyed gaze, jostling Arthur with shock and pain, <i>so much pain,</i> when the image superposed with a memory from his past, of a blue-eyed blonde boy who welcomed him heartily at the port.
 
A different boy. A boy who is now dead.
 
&ldquo;NO!&rdquo; Arthur pushed the boy away and ran, ran as fast as his feet could bring him, as far away as possible from that, that <i>replacement</i>. That poor imitation nature had chosen.
 
&ldquo;Franklin!&rdquo; Mrs. Jones exclaimed when her boy fell to the floor. She rushed to his side. &ldquo;My boy, my dear-&rdquo;
 
&ldquo;I&rsquo;m sorry,&rdquo; the boy who used to rely on her so much, to curl at side and lean on her in her embrace, got up before she could help him, and stared at her with his blue eyes &ndash; not the eyes her son was born with, now timeless and wise beyond comprehension. &ldquo;I am not Franklin anymore. I am Alfred [4].&rdquo; Those foreign eyes were filled with apology and melancholy.
 
Before she could protest, her boy had turned to the forgotten two occupants of the room. &ldquo;Matthew,&rdquo; he smiled at the stranger, and nodded to the President. &ldquo;Boss, I&rsquo;m back.&rdquo;
 
Lincoln merely blinked, unable to comprehend the unexplainable sense of familiarity, protectiveness and pride swelling in his chest for this boy he&rsquo;d just met, while tears began to flood Matthew&rsquo;s cheeks (again) before the quiet blonde dropped to his knees and pulled America into his arms. He buried his nose to his hair and inhaled the long-missed scent of coffee, fresh soil and the sun. &ldquo;Welcome back, Alfred.&rdquo;
 
------------------------------
 
1921
 
&ldquo;Arthur.&rdquo;
 
The island nation froze and inhaled sharply before he looked up across the meeting table, his green eyes cold as he regarded one of the participants of the Four-Power Treaty. &ldquo;America.&rdquo;
 
After six decades, Franklin Jones had transformed to an exuberant youth, his frame filling up with muscles and his skin a healthier shade of tan, his leg no longer disabled, his jaw squaring and <i>by God</i>, he was becoming achingly more and more similar with-
 
<i>No</i>, Arthur forced his thoughts to screech to a halt. <i>Alfred is dead. Gone from this world.</i>
 
The blue-eyed male smiled wryly. &ldquo;Arthur, when are you ever going to call me Alfr-?&rdquo;
 
&ldquo;Franklin,&rdquo; Arthur interrupted, and passed his new ally the contract he&rsquo;d recently signed, the fresh black ink barely drying on the parchment, &ldquo;Never.&rdquo;
 
The younger nation flinched visibly, his lips pressed together to a thin line.
Arthur sighed inwardly as silence descended between them. Arthur could literally feel Matthew&rsquo;s glare on his back, his anger at Arthur for making his neighbour (Arthur refused to think of them as brothers. <i>They weren&rsquo;t brothers</i>) upset palpable. Arthur cleared his throat. &ldquo;About NACA [5],&rdquo; he attempted a conversation, &ldquo;I heard you appointed an engineer into the board.&rdquo;
 
&ldquo;You know about that?&rdquo; America perked up. &ldquo;Yeah! He made them adopt a new and ambitious mission and all. They&hellip;&rdquo;
 
Arthur let himself be lost in Franklin&rsquo;s rambling.
 
<i>Alfred would never have done that. Alfred didn&rsquo;t care in aerospace [6]. Franklin, you do. </i>
 
<i>You are fundamentally different from him. </i>
 
Arthur would never be fooled to believing otherwise. He&rsquo;d said goodbye to his baby long, long ago.
 
TBC to

3. <i>We Thought We Had All the Time in the World</i>
 
PortxIggy next chapter. If I have time to write. Most likely not.
 
Note:
<ol>
<li>Jacques Chevalier is my headcanon&rsquo;s France before he died in the French Revolution and was replaced by Francis Bonnefoy. The original kinkmeme fill did mention that Arthur had never lost France again after the Revolution, after all.</li>
<li>&lsquo;p&egrave;re&rsquo; is French for father.</li>
<li>No joke. I found the info at Wikipedia. During 1850 census those were the wordings they used. W = white, B = black. There were also categories for slaves and free men. The parts for hair and eyes are just for my benefits, because they still had no coloured photography back then /o\</li>
<li>The premise I have here is that Alfred Williams&rsquo; feelings had infused itself to the &lsquo;spirit&rsquo; of America too much, because Alfred Williams had been America for so long &ndash; over two hundred years. He was also the first human to embody America. This yearning for reconciliation with Arthur is like Alfred&rsquo;s unfinished business, his regret, which passed on to Franklin like a ghost.</li>
</ol>Generally, when a human who embodies a nation dies and a new human is selected, how much of his/her human identity s/he retains varies, depending on the age s/he stops being human and start becoming a nation, and the strength of the nation&rsquo;s patriotism and culture and so on.
<ol>
<li value="5">NACA is NASA&rsquo;s predecessor.</li>
<li>Alfred cared about justice, freedom and fairness. Alfred loved sports and animals. Alfred didn&rsquo;t have so much interest in the stars and flying. That&rsquo;s the headcanon in this AU.</li>
</ol></lj-cut>
